// @lc code=start
class Solution {
public:
    int minDominoRotations(vector<int>& tops, vector<int>& bottoms)
    {
        int n = tops.size();
        int status = 0;
        int t = tops[0];
        int b = bottoms[0];
        int tflip = 0, bflip = 0, tboth = 0, bboth = 0, tkeep = 0, bkeep = 0;
        bool tposi = true, bposi = true;
        for (int i = 1; i < n; ++i) {
            if (tposi) {
                if (tops[i] == bottoms[i] && tops[i] == t) {
                    tboth++;
                } else if (tops[i] == t) {
                    tkeep++;
                } else if (t == bottoms[i]) {
                    tflip++;
                } else {
                    tposi = false;
                }
            }
            if (bposi) {
                if (bottoms[i] == tops[i] && tops[i] == b) {
                    bboth++;
                } else if (b == bottoms[i]) {
                    bkeep++;
                } else if (b == tops[i]) {
                    bflip++;
                } else {
                    bposi = false;
                }
            }
            if (!tposi && !bposi) {
                return -1;
            }
        }
        int res = 99999;
        if (tposi) {
            res = min(tflip, tkeep + !(t == b));
        }
        if (bposi) {
            res = min(res, bflip);
            res = min(res, bkeep + !(t == b));
        }

        return res;
    }
};
